export const Presentational=({rows, setRows, clickAddUser})=>{
    return(
        <div>
            <h2>LISTADO DE USUARIOS</h2>
            <button onClick={clickAddUser}>Agregar usuario</button>
            <table>
                <thead>
                    <tr>
                        <th>Nombre</th>
                        <th>Apellido</th>
                        <th>Email</th>
                        <th>Teléfono</th>
                        <th>Rol</th>
                    </tr>
                </thead>
                <tbody>
                    {(rows &&
                    rows.map((item, i) => {
                        return [
                            <tr key={i}>
                            <td>{item.first_name}</td>
                            <td>{item.last_name}</td>
                            <td>{item.email}</td>
                            <td>{item.phone}</td>
                            <td>
                            {
                                {
                                1: "Administrador",
                                2: "Bibliotecario",
                                3: "Lector",
                                }[item.profile_id]
                            }
                            </td>
                            </tr>
                        ];
                    })
                    )}
                </tbody>
            </table>
        </div>
    )
}
